    "billboard_df = pd.read_csv('billboard_hot_100.csv')\n",
    "artists = billboard_df['artist'].unique()\n",
    "\n",
    "# Аутентификация MusicBrainz \n",
    "musicbrainzngs.set_useragent(\"AYEAPP\", \"0.1\", \"abbastaeva@gmail.com\")\n",
    "\n",
    "def get_artist_location(artist, retries=5):\n",
    "    delay = 1\n",
    "    for i in range(retries):\n",
    "        try:\n",
    "            result = musicbrainzngs.search_artists(artist=artist, limit=1)\n",
    "            if result['artist-count'] > 0:\n",
    "                artist_info = result['artist-list'][0]\n",
    "                if 'area' in artist_info:\n",
    "                    return artist_info['area']['name']\n",
    "                if 'begin-area' in artist_info:\n",
    "                    return artist_info['begin-area']['name']\n",
    "        except (URLError, musicbrainzngs.WebServiceError) as e:\n",
    "            print(f\"Error fetching data for artist {artist} (attempt {i+1}/{retries}): {e}\")\n",
    "            time.sleep(delay)\n",
    "            delay *= 2  \n",
    "    return None\n",
    "\n",
    "artist_locations = {}\n",
    "for artist in artists:\n",
    "    location = get_artist_location(artist)\n",
    "    if location:\n",
    "        artist_locations[artist] = location\n",
    "    time.sleep(2)  # Чтобы не забанили запросы\n",
    "\n",
    "\n",
    "locations_df = pd.DataFrame(list(artist_locations.items()), columns=['artist', 'location'])\n",
    "print(locations_df.head())\n"
